import React, { useState, useEffect } from "react";

export function Orders() {
  const [details, setDetails] = useState([]);

  useEffect(() => {
    const getDetails = () => {
      axios
        .get("https://assessment.api.vweb.app/orders")
        .then((response) => {
          setDetails(response.data);
        })
        .catch((error) => console.log(`Error: ${error}`));
    };
    getDetails();
  }, []);

  return details;
}
